    height="1em"
    viewBox="0 0 24 24"
    data-name="Line Color"
    xmlns="http://www.w3.org/2000/svg"
    className="linkedin-svgrepo-com_svg__icon linkedin-svgrepo-com_svg__line-color"
    {...props}
  >
    <path
      d="M16 17v-3a2 2 0 0 0-2-2h0a2 2 0 0 0-2 2v3"
      style={{
        fill: "none",
        stroke: "#2ca9bc",
        strokeLinecap: "round",
        strokeLinejoin: "round",
        strokeWidth: 2,
      }}
    />
    <path
      data-name="secondary"
      d="M8 12v5m4-3v-2"
      style={{
        fill: "none",
        stroke: "#2ca9bc",
        strokeLinecap: "round",
        strokeLinejoin: "round",
        strokeWidth: 2,
      }}
    />
    <path
      style={{
        fill: "none",
        stroke: "#2ca9bc",
        strokeLinecap: "round",
        strokeLinejoin: "round",
        strokeWidth: 2,
      }}
      d="M7.95 7.5h.1"
    />
    <rect
      x={3}
      y={3}
      width={18}
      height={18}
      rx={1}
      style={{
        fill: "none",
        stroke: "#000",
        strokeLinecap: "round",
        strokeLinejoin: "round",
        strokeWidth: 2,
      }}
    />
  </svg>
);
export default SvgLinkedinSvgrepoCom;
